const Footer = () => (
<>
    <div className="footer p-3 panelShadow m-0">
        <div className="container">
          <p>+3803803803</p>
          <p><a className="text-primary" href="https://t.me/Konan_Doill">Telegram</a></p>
          <p><a className="text-danger" href="https://www.instagram.com/just.kitaiev">Instagram</a></p>
          <p>testemail@gmail.com</p>
         </div>
      </div>
    </>
);

export default Footer;
